import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
  players: number = 1;

  increment(){
    this.players += 1;
  }
  decrement(){
    if(this.players >1){
      this.players += 1;
    }
  }
}
